import React from "react";

import { Modal, Form } from "antd";
import PersonModalForm from "./personModalForm";

const PersonModal = ({ visible, data, onCancel, onhandleUpdate }) => {
  const [form] = Form.useForm();
  return (
    <Modal
      closable={false}
      visible={visible}
      okText="Edit"
      cancelText="Cancel"
      onCancel={onCancel}
      onOk={() => {
        form
          .validateFields()
          .then(values => {
            form.resetFields();
            onhandleUpdate(values);
          })
          .catch(info => {
            console.log("Validate Failed:", info);
          });
      }}
    >
      <PersonModalForm form={form} data={data} />
    </Modal>
  );
};

export default PersonModal;
